import { AppBar, Tabs, Toolbar,  } from '@mui/material';

const Header = styled(AppBar)`
background: #111111
`;

const NavBar = () => {
    return (
        <Header>
            <Toolbar>
                <Tabs>Home </Tabs>
                <Tabs>All Users</Tabs>
                <Tabs>Add User</Tabs>
            </Toolbar>
        </Header>
    )
}

export default NavBar;
